import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import axios from 'axios';
import '../../services/Consulting/consulting.css';

const ContactUsSection = () => {
  return (
    <div className="contact-us-section">
      <h2 className="contact-title">CONTACT US</h2>
      <p className="contact-subtitle">
        We align leaders around a shared purpose and strategic story that catalyzes their business and brand to take action.
      </p>
      <div className="contact-info">
        <div className="contact-item">
          <div className="contact-icon address-icon"></div>
          <h3>Address:</h3>
          <p>121 Rock Street, 21 Avenue, New York, NY 92103-9000</p>
        </div>
        <div className="contact-item">
          <div className="contact-icon email-icon"></div>
          <h3>Email:</h3>
          <p>hello@company.com</p>
          <p>support@company.com</p>
        </div>
        <div className="contact-item">
          <div className="contact-icon phone-icon"></div>
          <h3>Call us:</h3>
          <p>1 (234) 567-891</p>
          <p>1 (234) 987-654</p>
        </div>
      </div>
      <div className="map-background"></div>
    </div>
  );
};

const ConsultingPage = () => {
  const navigate = useNavigate();

  // Formik setup and other content as it is...

  return (
    <div className="consulting-page">
      {/* Existing content */}
      <ContactUsSection />
    </div>
  );
};

export default ConsultingPage;
